INSERT INTO `en_questao` (`COD_QUESTAO`,`COD_ENQUETE`,`ORDEM`,`QUESTAO`) VALUES 
 (1001,1,10,'Nossa empresa adota a filosofia do trabalho em equipe.'),
 (1002,1,20,'Sei o que se espera do meu trabalho.'),
 (1003,1,30,'Na minha área de trabalho, as instalações físicas são adequadas.'),
 (1004,1,40,'Percebo que meu trabalho me possibilita crescer profissionalmente.'),
 (1005,1,50,'Na minha área de trabalho a liderança pratica o que prega.'),
 (1006,1,60,'Trabalho numa empresa que transmite uma imagem positiva ao publico externo.'),
 (1007,1,70,'Tenho um salário condizente com o mercado.'),
 (1008,1,80,'Sinto o apoio do colegas e dos líderes.'),
 (1009,1,90,'Conhecemos os objetivos e estratégias da nossa área de trabalho.'),
 (1010,1,100,'As condições de trabalho em minha área são adequadas.'),
 (1011,1,110,'Sinto que os líderes estão sempre abertos a novas idéias.'),
 (1012,1,120,'Aqui na empresa existem programas de treinamento que melhoram minha qualificação.'),
 (1013,1,130,'trabalho numa empresa que se preocupa com meio ambiente.'),
 (1014,1,140,'Recebo meu salário em dia e entendo todos os descontos praticados.'),
 (1015,1,150,'Planejamento dos projetos e direcionado a satisfação dos clientes.'),
 (1016,1,160,'Podemos expressar nossos pontos de vista sem medo de punições.'),
 (1017,1,170,'Nosso empenho para atingir metas é sempre reconhecido.'),
 (1018,1,180,'Trabalho numa empresa sólida e confivél.'),
 (1019,1,190,'Temos os recursos de trabalho(máquinas e equipamentos) necessários para fazer o trabalho.'),
 (1020,1,200,'A decisão dos líderes é baseada em fatos concretos e não em pré-julgamentos.'),
 (1021,1,210,'Trabalho em uma empresa que possui critérios definidos e claros para promoções.'),
 (1022,1,220,'Mantemos um bom relacionamento com os colegas.'),
 (1023,1,230,'Trabalho numa empresa socialmente responsável.'),
 (1024,1,240,'Quando existem conflitos entre nós, nosso líderes sabem administra-los.'),
 (1025,1,250,'Consigo realizar meu trabalho, fazendo oque é importante primeiro.'),
