INSERT INTO `msg_mensagem` (`COD_MENSAGEM`,`COD_EMPRESA`,`ASSUNTO`,`MENSAGEM`,`DT_ENVIO`) VALUES 
 (1,NULL,'VBOSS','Oi, amor.. efetuado o cadastro no VBOSS.\r\nJá cadastrei praticamente todas minhas contas a pagar e receber ;-) Depois tenho de te mostrar como funciona e se vamos usar esse sistema mesmo ou se vamos pra o esquema de planilha, Bjs','2014-01-23 04:30:12'),
 (2,NULL,'PSIU!!!','Te amo!','2014-01-31 16:27:59'),
 (3,NULL,'PSIU','Uma vez tive um sonho, sonhava subir até uma das montanhas mais altas só pra te ver, e se lá não você não estiver, de lá gritarei seu nome para ver se me ouve, e se me ouvires,\r\ndirei uma só frase: Eu te amo.\r\nEsperava que o vento ao soprar venha levar consigo o que eu disse, e quando ele soprar em seu ouvido, escutarás junto ao vento: Eu te amo.\r\n','2014-02-22 20:19:23'),
 (4,NULL,'Re: PSIU','Lindooooo!\r\nEmocionante meu amor.. Me ocorreu a imagem e essa linda demonstração de amor. Espero que mesmo que eu não vá até as montanhas, você sinta o amor gigante que sinto por você. Te amo, te quero sempre ao meu lado. \r\nSem palavras.. emocionada mesmo... \r\nTe amo, te amo, te amo..\r\n\r\n<blockquote dir=\"ltr\" style=\"padding-right:0px; padding-left:5px; border-left:#000000 2px solid; margin-right:0px;\">\r\n	 <div style=\"font: 11px arial;\">----- Original Message -----</div>\r\n	 <div style=\"background:#E4E4E4;font: 11px arial; color:#000000;\"><b>De: </b>aless</div>\r\n	 <div style=\"font: 11px arial;\"><b>Para:  </b>daiane; aless</div>\r\n	 <div style=\"font: 11px arial;\"><b>Enviado:  </b>Sábado, 22 de Fevereiro de 2014, 20:19</div>\r\n	 <div style=\"font: 11px arial;\"><b>Assunto:  </b>PSIU</div>\r\n	 <div><br></div>\r\n	 <div><font style=\"font: 11px arial;\">Uma vez tive um sonho, sonhava subir até uma das montanhas mais altas só pra te ver, e se lá não você não estiver, de lá gritarei seu nome para ver se me ouve, e se me ouvires,\r\ndirei uma só frase: Eu te amo.\r\nEsperava que o vento ao soprar venha levar consigo o que eu disse, e quando ele soprar em seu ouvido, escutarás junto ao vento: Eu te amo.\r\n</font></div>\r\n</blockquote>','2014-02-25 20:32:29'),
 (5,NULL,'Re: PSIU!!!','Oiiii... \r\n\r\nTe amo meu tudo!!!\r\n\r\n<blockquote dir=\"ltr\" style=\"padding-right:0px; padding-left:5px; border-left:#000000 2px solid; margin-right:0px;\">\r\n	 <div style=\"font: 11px arial;\">----- Original Message -----</div>\r\n	 <div style=\"background:#E4E4E4;font: 11px arial; color:#000000;\"><b>De: </b>aless</div>\r\n	 <div style=\"font: 11px arial;\"><b>Para:  </b>daiane; aless</div>\r\n	 <div style=\"font: 11px arial;\"><b>Enviado:  </b>Sexta-feira, 31 de Janeiro de 2014, 16:27</div>\r\n	 <div style=\"font: 11px arial;\"><b>Assunto:  </b>PSIU!!!</div>\r\n	 <div><br></div>\r\n	 <div><font style=\"font: 11px arial;\">Te amo!</font></div>\r\n</blockquote>','2014-02-25 20:32:53');
