 (72,26,5,'Colocar cabo de rede na máquina; logar-se como \"administrador/athenas\" e colocar máquina na rede; usar usuário e senha da conta \"administrator\" (do servidor) para colocar máquina na rede.','Instalador','Após 4','',''),
 (73,26,4,'Conforme o KIT, ativar a licença do Windows. Usar opção ATIVAR POR TELEFONE.<br><br> Após a instalação e ativação do Windows, copiar a pasta I386\\ que está dentro do CD-ROM do WinXP. Solicitar os Drivers adequados de sua máquina e realizar instalação; em seguida conectar-se ao Windows Update e realizar TODAS atualizações.','Instalador','Após 3','',''),
 (74,26,6,'Depois de entrar na rede, reiniciar a máquina e se logar com nome da máquina. No Active Directory do servidor, existe uma conta chamada <i>DefaultUser</i>, que poderá ser usada para criar uma nova conta de usuário.','Instalador','Após 5','',''),
 (75,26,7,'Mapear, caso a caso, os drives de rede do servidor ATENA de acordo com a lista abaixo:<br>\r\nG - Athenas<br>\r\nI - Internet<br>\r\nL - Library<br>\r\nP - Projetos<br>\r\nR - Suporte<br>\r\nW - wwwroot THE_ATENA<br>\r\nX - wwwroot THE_GAIA<br>','Instalador','Após 6','',''),
