 (91,26,17,'Configurar assinatura de e-mail segundo o modelo: <i>R:ModeloEmailBASICO.html</i>.','Instalador','Após 16','',''),
 (92,26,18,'<u>Arquivos temporários da Internet</u><br>\r\nConfigurar o IE para apagar o cache da Internet sempre que o navegador for fechado. Para isto, vá no Painel de Controle > Opções da Internet > Avançado e, na seção Segurança, ative a opção \"Esvaziar Arquivos temporários quando o navegador for fechado\".','Instalador','Após 17','',''),
 (93,26,19,'<u>Abra o Windows Explorer com \"Meu Computador\" expandido</u><br>\r\nCrie um novo atalho para o Windows Explorer, dique nele com o botão direito, selecione Propriedades. No campo Objeto, coloque a seguinte linha, apagando antes a já existente:<br><br>\r\n%SystemRoot%\\explorer.exe /e,, C:\\<br>','Instalador','Após 18','',''),
 (94,26,20,'<u>Desabilite Serviços que abrem brechas</u><br>Para desabilitar o Telnet, vá em Painel de Controle > Ferramentas Administrativas > Serviços. Altere o serviço Telnet de \"manual\" para \"desabilitado\". Desative também os serviços \"Compartilhamento remoto da área de trabalho do NetMeeting\", \"Registro Remoto\" e \"Mensageiro\".','Instalador','Após 19','',''),
 (95,26,21,'<u>Desabilite a Notificação de Erros à Microsoft</u><br>Para evitar que o Windows recomente enviar um relatório a Microsoft, vá nas propriedades de Sistema (Painel de Controle > Sistema), em Avançado > Notificação de Erros, e selecione \"Desabilitar a Notificação de Erros\".','Instalador','Após 20','',''),
