 (101,30,6,'No sistema (pasta SERVER\\n-letter\\_n-letter\\modulo_PRINCIPAL)<br><br>\r\nO arquivo LOGIN.ASP deve ser modificando inserindo-se uma nova linha no combo correspondente a esse novo cliente.','programador','depois de 5','',''),
 (102,30,7,'Deve ser efetuado o ulload de todos os elementos envolvidos<br>\r\n- Banco do cliente (n-letter_NOMEdoCLIENTE.mdb)<br>\r\n- Pasta do cliente no ambiante do nlettar (NOMEdoCLIENTE\\)<br>\r\n- _n-letter\\modulo_PRINCIPAL\\login.asp<br>\r\n','Programador','depois de 6','',''),
 (103,30,8,'Entrar no sistema no Banco do Cliente, utilizando a conta do usuário oculto athenas (caso não saiba a senha verificar com o Gerente de Contas)<br>\r\nApós entrar no sistema criar o usuário para o cliente. <br>\r\nCaso seja identificado defeito, retornar ao ponto inicial e verifica todos os passos tomados, executá-los até que o sistema esteja permitindo o login deste novo usuário cadastrado','programador','depois de 7','',''),
