 (105,31,1,'Padrão a ser usado:<br><br>\r\n<b>[dominio] ([tipo]): texto</b>\r\n<br><br>\r\nOnde:<br>\r\n<u>dominio</u> vai ser o nome principal do domínio do site e/ou sistema<br>\r\n<u>tipo</u> vai ser \"Site\", \"AR/AS\" (área restrita ou área de serviços) e \"CSM\"<br>\r\n<u>texto</u> vai ser o texto usado como assunto da mensagem\r\n<br><br>\r\nexemplos:<br>\r\n<i>\r\nCADS (site): Inscrição efetuada<br>\r\nBalearic (Site): Cadastro de Representante<br>\r\nBondmann (Site): Cadastro para Newsletter<br>\r\nJJ Chaves (AR/AS): Mensagem Recebida<br>\r\nExpoSystems (Site): Credenciamento Imprensa<br>\r\n</i>','Executor da tarefa','Alterando fontes','',''),
