 (107,32,10,'Verificar emails no domínio do Plano Revenda os emails, forward e alias existentes.<br><br>\r\nAcesso ao Plano Revena:<br><br>\r\nurl: https://pleskwin06.hospedagemdesites.ws:8443/login.php3<br><br>\r\nuser:athenas<br>\r\nsenha:ath2008enas<br><br>\r\n*Anotar cuidadosamente em uma planilha excel, todos os emails, alias, forwards e configurações especiais.\r\n<br><br>\r\n**Verificar também se o domínio é um forward ou é host físico','EXECUTOR','MIGRANDO SITE','',''),
