 (110,32,40,'Efetuar o upload do site (páginas) para o novo plano IDC','EXECUTOR','Depois de 30','',''),
 (111,32,50,'Dar dieito ao ILUSR_ para as pastas necessárias, normalmente: /private/_DB. IMGDIN, UPLOAD, SWF e RSS. <br>\r\nAtenção para casos especiais, como no caso de sites gerenciados apartir do athCSM III.','EXECUTOR','Depois de 40','',''),
 (112,32,60,'Baixar o Banco de Dados do site que esta sendo migrado. Lembrar de antes renomeá-lo para que o site entre em modo de manutenção','EXECUTOR','Depois de 50','',''),
 (113,32,70,'Compactar o Banco de Dados. Colocar ele em execução no servidor local (ATENA)','EXECUTOR','Depois de 60','',''),
 (114,32,80,'Subir o banco paara o IDC','EXECUTOR','Depois de 70','',''),
 (115,32,90,'Ativar e-mails do IDC','EXECUTOR','Depois de 80','',''),
 (116,32,100,'Solicitar a um supervisor (Aless, Tati ou Cleverson) para alterar DNS do Registro.br<br><br><br>\r\nAntigos (revenda)<br><BR>\r\nns1.dominio.com.br<br>\r\n200.234.220.5<br><br>\r\nns2.dominio.com.br<br>\r\n200.234.220.6<br><br>\r\nNOVOS (IDC)<br><BR>\r\nns1.dominio.com.br<br>\r\n201.76.48.153<br><br>\r\nns2.dominio.com.br<br>\r\n201.234.215.85<br><br>\r\n','SUPERVISOR','Depois de 90','',''),
 (117,32,110,'Avisar o cliente das possíveis novas senhas de e-mail e passar a url para acesso aos e-mails antigos. <br><br>\r\nApós liberação do cliente sobre os e-mails antigos, remover site do plano revenda antigo.<br><br><br>\r\n*ATENÇÃO especial para clietne que usam webmail (que não baixam seus e-mails), nestes casos verificar qual é processo de envio destes e-mails da conta antiga para a nova conta no IDC.','GER.CONTA','Depois de 100','',''),
 (118,32,5,'Avisar a Gerente de Conta qual o domínio que será iniciada a migração, para que ela envie aviso ao cliente avisando de possíveis instabilidades no site e emails.','EXECUTOR','MIGRANDO SITE','',''),
 (119,32,95,'Efetuar todos os testes de navegação no ambiente IDC antes de solicitar ao supervisor a troca dos DNSs.\r\n<br><br>\r\nTanto no site como no athcsm, testar as seguintes funções em todos os módulos (Lógica de Revista, banners, links relacionados, imagens relacionadas, editor html):\r\n<br>\r\n<li> deleção;\r\n<li> alteração;\r\n<li> inserção;\r\n<li> upload.','EXECUTOR','MIGRANDO SITE','',''),
 (120,33,1,'Recebimento do Bem','Resp Inventário','Inicial','',''),
 (121,33,3,'Cadastramento dos bens que compõem a nota fiscal.\r\nObservar Código da etiqueta colada, conferir a descrição conforme consta na nota fiscal.','Resp Inventário','após 2','',''),
 (122,33,2,'Colar etiqueta de idenficação no bem.\r\nFixar em local visivel e discreto.','Resp Inventário','após 1','',''),
 (124,33,4,'Repassar o equipamento ao local de uso','Resp Inventário','após 1','',''),
 (125,34,1,'Avisar responsável do inventario para qual o novo local do equipamento','UserEquipamento','Inicio','',''),
 (126,34,2,'Informar a etiqueta que esta fixada no material para o resp. do inventario.','UserEquipamento','apos 1','',''),
 (127,34,3,'Registrar no Vboss no item de inventario do equipamento que foi realocado o novo local de uso','RespInventario','apos2','',''),
 (128,35,1,'Avisar responsável do inventario motivo do equipamento ser dispensavel','UserEquipamento','Inicio','',''),
 (129,35,2,'Dar baixa na listagem do inventario de equipamento no Vboss para a etiqueta fixada no equipamento','RespInventario','Apos1','',''),
 (130,35,4,'Encaminhar equipamento para doação, se for o caso chamar Mensageiro da caridade POA: 51 3223-2555','RespInventario','apos3','',''),
 (132,35,3,'Destruir etiqueta de inventario','RespInventario','após 2','',''),
 (134,36,1,'Aceite do cliente e/ou Geração de cobrança de contratos','comercial','inicial','',''),
 (135,36,2,'Inserir no VirtualBoss uma NF/Recibo com os dados da receita a ser gerada, modelo (Recibo ou nf-e), cliente, data de emissão, prazo de vencimento, descrição do serviço e o código do serviço para ser utilizado na NF-e da PMSP.','comercial','após 1','',''),
 (136,36,3,'A partir da relaão de NF/Recibos \"Não emitidas\", selecionar aqueles com dt. emissão = \"hoje\", e emitir a NF-e no site da PMSP (https://nfe.prefeitura.sp.gov.br), ou o Recibo, conforme o modelo indicado','Adm/Fin','após 2','',''),
 (137,36,4,'Gerar o boleto no site do Itau com o valor total da NF-e emitida no site da PMSP, ou do Recibo, conforme o modelo.','Adm/Fin','após 3','',''),
 (138,36,5,'Registro de NF emitida no VirtualBoss.  Caso a NF-e tenha alguma retenção, atualizar a NF do VirtualBoss com o valor exato da NF-e, e clicar em \"Emitir NF\" no VirtualBoss, marcando a NF como emitida.','Adm/Fin','após 4','',''),
 (139,36,6,'Gerar a conta a receber diretamente a partir da NF, clicando no icone \"Gerar Conta\".','Adm/Fin','após 5','',''),
 (140,37,1,'VERIFICAR NO VB SE O PONTO DOS FUNCIONÁRIOS ESTA CORRETO.','ADMINISTRATIVO','16 DE CADA MÊS','','');
